// import {searchEmployees} from './util/API';
import {Card, CardGroup, CardDeck,Container, Col} from 'react-bootstrap';
function EmployeeList(props){

    return(
<div className="employee">
    <Container>
<CardDeck>
        {props.results.map((employee)=>(
            <Col md={5} className='card-col'>
        <Card style={{maxHeight:'20rem', overflowY: 'scroll'}}className='card'>
        <Card.Img  variant="top" src={employee.picture.small} alt={employee.name.first.toLowerCase()}/>
        <Card.Body>
        <Card.Title>{employee.name.first.toLowerCase()} {employee.name.last}</Card.Title>
        <Card.Text>
        Employee ID:{ employee.id.value}
        </Card.Text>
        <Card.Text>
        email:{employee.email}
        </Card.Text>
        </Card.Body>
        </Card>    
        </Col>
                ))}
        </CardDeck>
        </Container>
        </div>
    )
}

export default EmployeeList;
